import React from "react";
import { Card, Row, Col } from "react-bootstrap";

const PortfolioCard = (props) => (
  <Card border="light">
    <Card.Img src={props.ImageLink} alt={props.ImageAlt} />
    <Card.ImgOverlay />
      <Row className="my-2">
        <Col md={4}>
          <h3>{props.Headline}</h3>
        </Col>
        <Col md={8}>
          <p className="mt-2">{props.Subheader}</p>
        </Col>
      </Row>
  </Card>
);

export default PortfolioCard;
